from functools import lru_cache
def solve():
    n,a,b = map(int,input().split())

    @lru_cache(None)
    def dfs(n : int) -> int:
        if n == a or n == b:
            return 0
        if n < a and n < b:
            return n

        ans1,ans2 = n + 1,n + 1
        if n >= a:
            ans1 = dfs(n - a)
        if n >= b:
            ans2 = dfs(n - b)

        return min(ans1,ans2)

    print(dfs(n))

solve()

