    elif n<b:
        return n%a
    if n==a or n==b:return 0

    dp = [False]*(n+1)
    dp[a]=dp[b]=dp[0]=True
    coins = [a,b]
    for i in range(1,n+1):
        for coin in coins:
            if i>coin:
                dp[i] |= dp[i-coin]
    for i in range(n,-1,-1):
        if dp[i]:
            return n-i

print(solve(n,a,b))

