    if n<a and n<b:
        return n
    elif n%a==0 or n%b==0:
        return 0
    elif n<b:
        return  n%a
    elif n<a:
        return n%b
    coins, coin=n//a, n//b
    mins=n
    for i in range(0,coins+1):
        for j in range(0,coin+1):
            if n-i*a-j*b<0:
                break
            mins=min(mins,n-i*a-j*b)
    return mins

